import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';

const projects = [
  { title: 'Projeto 1', description: 'Descrição breve do projeto incrível.' },
  { title: 'Projeto 2', description: 'Outro projeto inovador que desenvolvi.' },
  { title: 'Projeto 3', description: 'Mais um projeto que merece destaque.' }
];

const ProjectList = () => {
  return (
    <div className="projects">
      {projects.map((project, index) => (
        <div key={index} className="project-card">
          <h3>{project.title}</h3>
          <p>{project.description}</p>
        </div>
      ))}
    </div>
  );
};

ReactDOM.render(<ProjectList />, document.getElementById('project-list'));
